    {
      "type": "headline",
      "text": "HAPPY NEW YEAR!",
      "bbox": {
        "x": 0,
        "y": 380,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "byline",
      "text": "By Anatoli Sofronov",
      "bbox": {
        "x": 0,
        "y": 400,
        "width": 100,
        "height": 10
      }
    },
    {
      "type": "paragraph",
      "text": "ONLY two years ago I visited the United States of America as a member of a delegation of seven Soviet journalists, and it is with pleasure that I recall the hospitality of the American people. Our countries are divided by the Atlantic and Pacific oceans, and we have different social systems. In spite of this, we have a lot in common. Yes, our people are really very much alike. I feel it at the moment these lines are being written the way I felt it at the time when we were crossing America by plane, when we met hundreds of people and learned something of the life of the country.",
      "bbox": {
        "x": 0,
        "y": 410,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "We heard the wish for peace and friendship between our peoples repeated time and again by Americans in all walks of life, from the Cleveland industrialist to the bricklayer from Salt Lake City. I would like to meet again the farmer from Arizona who showed us his livestock farm and thoroughbred racing horses. How good it would be to clasp the hand of the old ship's mechanic who more than once bathed in the icy waves of the North Sea during the war when he was convoying arms deliveries to the Soviet Union. He has retired on a pension, and we met him in San Francisco.",
      "bbox": {
        "x": 0,
        "y": 470,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "With the greatest pleasure would I talk to the San Francisco editor who received us in his home and proudly showed us his sleeping children. Continued on next page2",
      "bbox": {
        "x": 0,
        "y": 530,
        "width": 100,
        "height": 40
      }
    },
    {
      "type": "image",
      "text": "Image of a parade in Moscow's Red Square",
      "bbox": {
        "x": 0,
        "y": 570,
        "width": 100,
        "height": 100
      }
    },
    {
      "type": "caption",
      "text": "1958 MARKS THE FIRST YEAR OF THE SOVIET STATE'S FIFTH DECADE. ANNIVERSARY PARADES LIKE THIS, IN MOSCOW'S RED SQUARE, TOOK PLACE ALL OVER THE COUNTRY.",
      "bbox": {
        "x": 0,
        "y": 670,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "People in America looked at us in wonder, their curious glances traveling over our suits, shoes, ties and watches. They found that many things were similar to those made in any other country. But most important, they found that Soviet people were made of pretty much the same stuff as themselves. The year 1957 has departed, and the New Year has come. As the lights on the numerous fir trees are switched on and people gather around the holiday tables, they are in high spirits, looking forward to the new events the coming year is sure to bring, to new dreams and new plans taking shape in their minds.",
      "bbox": {
        "x": 0,
        "y": 690,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "We have good reason to feel happy and elated today. The year 1957 was a good year for us, and we gathered momentum for the future. I am not talking about the launching of the earth's first artificial satellites, a feat that crowned all of our scientific and technological achievements. The sputniks are the pinnacle, but the path leading to the top is paved with the remarkable achievements of Soviet scientists, engineers, workers and farmers.",
      "bbox": {
        "x": 0,
        "y": 750,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "The industrial enterprises of Moscow alone produced up to 190 completely new models of machines, apparatus and instruments in 1957. The country's farmers raised a good crop. And though the fields of the Urals, Kazakhstan and the regions along the Volga River suffered from drought, the nation was supplied with all the grain it needs. Billions of rubles have been invested in housing construction and millions of families have moved into new apartments. Additional millions of acres of virgin land have been reclaimed for agriculture in Siberia and Kazakhstan, yielding their first crop of grain. Colossal hydroelectric stations have switched on myriads of new lights. Many new universities and institutes, thousands of schools and theaters have been opened. The movement for overtaking the USA in per capita production of meat, milk and butter has attained countrywide proportions. The world's most powerful synchrophasotron was set into action at the small town of Dubna, near Moscow. Shostakovich composed his Eleventh Symphony, which music lovers have called superb. Last summer Moscow threw open its doors to 34,000 young people from 130 countries who arrived at the World Youth Festival and experienced our hospitality firsthand.",
      "bbox": {
        "x": 0,
        "y": 810,
        "width": 100,
        "height": 80
      }
    },
    {
      "type": "paragraph",
      "text": "New Year's Eve has always been a time for celebration the world over. But for the people of my country this year it was a double event—the beginning of 1958, of course, and the beginning of the fifth decade of the Soviet state.I look back over these forty years with mixed emotions—pride in our achievements, satisfaction in the knowledge that what we have accomplished will be of help to all mankind, and a bit of sadness, too, in remembering the struggle of wars, the hardships and sacrifices of reconstruction. But everyone in my country knows that the spadework has been done now and that our past efforts will yield increasing rewards with each new year. That is why 1958 has special meaning for us.",
      "bbox": {
        "x": 0,
        "y": 890,
        "width": 100,
        "height": 80
      }
    },
    {
      "type": "paragraph",
      "text": "A lot is expected of the coming years. It is hard to predict what new discoveries and inventions human genius will make possible. But of one thing I am sure—whatever good the years bring to my country will be of benefit to other countries as well. We don't view our accomplishments in terms of narrow personal advantage but rather those of general usefulness. Now I don't mean to imply that the spirit of competition is not keen in my people. We do like to win and we get as much pleasure from being \"first\" as the next one, but never at the expense of good sportsmanship. Perhaps this example will give some insight into our character.",
      "bbox": {
        "x": 0,
        "y": 970,
        "width": 100,
        "height": 80
      }
    },
    {
      "type": "paragraph",
      "text": "Recently I made a trip to Krasnodar Territory, to the fertile Kuban. I heard the Kuban Cossacks say: \"We'll surely get ahead of Iowa in the production of milk, butter and meat.\" And I know that the people of the Kuban are true to their word. They have a high regard for the achievements of the Iowa farmers, and they want to bring their own farms up to these high standards. We have already made it known that we would welcome an exchange of visits between the farmers of Iowa and the collective farmers of the Kuban.",
      "bbox": {
        "x": 0,
        "y": 1050,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "The fervent wish of the Soviet people is peace with all the nations of the world, mutual assistance and mutual cooperation. I am convinced that this coincides with the dreams and wishes of hundreds of millions of people throughout the world. And it is natural that this wish should be nearest our hearts at the start of 1958. May this year become a landmark. May it become the happiest year for mankind, when economic and cultural relations among the nations of the world are strengthened and broadened in a spirit of international good will and confidence.",
      "bbox": {
        "x": 0,
        "y": 1110,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "caption",
      "text": "THE GAIETY OF THESE UKRAINIAN YOUTHS REFLECTS BOTH THE CONFIDENCE AND THE GREAT OPTIMISM OF THE COUNTRY AS IT PASSED ITS FORTY-YEAR MILESTONE",
      "bbox": {
        "x": 0,
        "y": 1170,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "image",
      "text": "Image of Ukrainian youths",
      "bbox": {
        "x": 0,
        "y": 1190,
        "width": 100,
        "height": 100
      }
    },
    {
      "type": "headline",
      "text": "SPUTNIK II",
      "bbox": {
        "x": 0,
        "y": 1290,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "headline",
      "text": "Cosmic Fact-Finder",
      "bbox": {
        "x": 0,
        "y": 1310,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "THE second man-made satellite was a larger, heavier and more complex version of Sputnik I. Its refinements were ordered by the fact that it was carrying a variety of complicated instruments and Laika, the first space traveler, whereas Sputnik I carried only relatively simple instruments.",
      "bbox": {
        "x": 0,
        "y": 1330,
        "width": 100,
        "height": 40
      }
    },
    {
      "type": "headline",
      "text": "The Instruments",
      "bbox": {
        "x": 0,
        "y": 1370,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "Sputnik II was launched as a final unit of a multistage rocket. This simplified its visual observation. In tracking the first sputnik, observers found it easier to follow the course of the carrier rocket than the satellite itself because of its greater luminosity. The carrier rocket was brighter than the satellite by several stellar magnitudes. In the forepart of Sputnik II a special frame enclosed the instrument to record short-wave radiation from the sun—the ultraviolet and X-rays. A spherical container resembling that of Sputnik I carried two radio transmitters and sources of their power supply, thermal controls and sensitive elements to register such effects as fluctuations of temperature. Also in the forepart of the rocket was the airtight cabin which housed the dog and the instruments to record its physiological reactions.",
      "bbox": {
        "x": 0,
        "y": 1390,
        "width": 100,
        "height": 80
      }
    },
    {
      "type": "paragraph",
      "text": "Mounted on the body of the rocket were instruments for the study of cosmic rays, radiotelemetering equipment to transmit all the data recorded on the satellite, equipment for measuring temperature on the satellite's outer surface and inside it, sources of power supply for the satellite's scientific and measuring instruments. The total weight of all equipment, the dog and power sources was 1,120 pounds, six times as heavy as Sputnik I. The instruments and containers mounted on the rocket's frame were shielded from the aerodynamic and heat effects of the passage through the dense layers of the atmosphere by a special protective cone. After the satellite was thrust into its orbit the cone was jettisoned.",
      "bbox": {
        "x": 0,
        "y": 1470,
        "width": 100,
        "height": 80
      }
    },
    {
      "type": "headline",
      "text": "Satellites' Life",
      "bbox": {
        "x": 0,
        "y": 1550,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The speed imparted to Sputnik II by its rocket gave it an elliptical rather than a circular orbit. At its farthest distance from the earth it reached an altitude of better than a thousand miles, almost double that of the first sputnik. The resistance of the earth's atmosphere tends to act as a brake on the movement of a satellite. This alters the size and shape of its orbit. It meets the greatest resistance at the point where it comes closest to the earth, what is called the perigee of the orbit. At the farthest point from the earth, the apogee, the satellite moves in cosmic space, outside the earth's atmosphere, which extends, theoretically, to an altitude of about 600 miles.",
      "bbox": {
        "x": 0,
        "y": 1570,
        "width": 100,
        "height": 80
      }
    },
    {
      "type": "paragraph",
      "text": "Because the satellite gradually slows down, its elliptical orbit becomes smaller and its path more and more circular. When the orbit shrinks to a height of about 60 miles, atmospheric resistance becomes so great that the heat generated burns the satellite up like a meteor. Since the period of revolution of Sputnik II was greater than that of Sputnik I, it had less resistance to overcome. It could reasonably be assumed then that the second moon would traverse its orbit for an appreciably longer time than the first.",
      "bbox": {
        "x": 0,
        "y": 1650,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "As a result of world-wide trackings of the two sputniks, science should be able to forecast with accuracy the length of life of future satellites. This is only one of the many invaluable findings which data from the sputniks will give us. Continued on page 6",
      "bbox": {
        "x": 0,
        "y": 1710,
        "width": 100,
        "height": 40
      }
    },
    {
      "type": "image",
      "text": "Diagram of the forward section of Sputnik II",
      "bbox": {
        "x": 0,
        "y": 1750,
        "width": 100,
        "height": 100
      }
    },
    {
      "type": "caption",
      "text": "DIAGRAM OF THE FORWARD SECTION OF SPUTNIK II 1—Protective nose cone jettisoned after the satellite reached its orbit. 2—Instruments for studying the sun's radiation (ultra-violet and X-rays). 3—Sphere containing two radio transmitters and other instruments. 4—Frame enclosing the satellite's scientific equipment. 5—Airtight cabin for experimental dog.",
      "bbox": {
        "x": 0,
        "y": 1850,
        "width": 100,
        "height": 40
      }
    },
    {
      "type": "image",
      "text": "Photograph of the forward section shown in diagram above",
      "bbox": {
        "x": 0,
        "y": 1890,
        "width": 100,
        "height": 100
      }
    },
    {
      "type": "caption",
      "text": "PHOTOGRAPH OF THE FORWARD SECTION SHOWN IN DIAGRAM ABOVE. THE WEIGHT OF EQUIPMENT AND DOG WAS 1,120 POUNDS—SIX TIMES MORE THAN SPUTNIK I.",
      "bbox": {
        "x": 0,
        "y": 1990,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "headline",
      "text": "SOUTHWESTERN JUNE 1902",
      "bbox": {
        "x": 0,
        "y": 2010,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "headline",
      "text": "Sun's Short-wave Radiation",
      "bbox": {
        "x": 0,
        "y": 2030,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The data on the sun's short-wave radiation provided by Sputnik II are most important for further study in physics, astrophysics and geophysics. The amount of energy of the sun's short-wave radiation is comparatively small, tens of thousands of times less than the sun emits as visible light, but this radiation greatly affects the earth's atmosphere nevertheless. The reason for this is that short-wave radiation is extremely active. As the rays strike the air molecules, they break them down into atoms. These free atoms are known as ions and the strongly ionized upper layers of the atmosphere as the ionosphere.",
      "bbox": {
        "x": 0,
        "y": 2050,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "The condition of the exterior layers of the sun—the chromosphere, the gaseous layer around the sun, and the corona, the luminous envelope which we see only during a total eclipse—is not constant. It changes continually. Scientists believe that there is a close link between solar activity, chromospheric eruptions, and the ionospheric absorption of radio waves which is responsible for interruptions in radio communication. While the earth's atmosphere shields us from the deadly short-wave radiation of the sun, it has also made it impossible for us to study this vitally important phenomenon without getting outside the atmosphere. The instruments in Sputnik II measured the rays before they were absorbed by the atmosphere.",
      "bbox": {
        "x": 0,
        "y": 2110,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "Three photoelectronic multipliers, placed at an angle of 120 degrees to each other, served as radiation receivers. The electric signals given off by the multipliers trained on the sun were amplified by radio circuits and transmitted to the earth through the telemetric system. Along with data obtained by the sputnik instruments observations of solar radiation were made by the entire network of ground \"sun-service\" stations as part of the International Geophysical Year program. When all data are collected and organized, science will be able to draw its first significant conclusions as to the connection between solar short-wave radiation and the processes that take place in the outer layers of the sun and the state of the earth's ionosphere.",
      "bbox": {
        "x": 0,
        "y": 2170,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "headline",
      "text": "Cosmic Rays",
      "bbox": {
        "x": 0,
        "y": 2230,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The atomic nuclei of different elements are accelerated and acquire very great energies in the cosmos. The cosmic radiation that thus originates affords the opportunity of investigating outer space at great distances away from the earth and even the solar system. As cosmic rays travel toward the earth from their birthplaces, they undergo the effects of the surroundings through which they pass. Due to various processes taking place in outer space, their composition and intensity change. The number of cosmic-ray particles increases, for example, if there are intensive explosions on the sun and the conditions are created for accelerating atomic nuclei. There is reason to expect that in such cases only the number of particles with small energies increases, while the number of particles with high energies remains without change.",
      "bbox": {
        "x": 0,
        "y": 2250,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "The sun is also the source of corpuscular radiation whose streams have intensive magnetic and electric fields. It is believed that the effects of this radiation on cosmic rays as well as fluctuations in the earth's magnetic field change the number of particles with both small and high energies. In order to understand the nature of the transformations cosmic rays undergo in outer space, we must not only establish increases or decreases in the intensity of cosmic radiation, but also determine how the number of particles with different energies changes. Cosmic-ray particles are strongly deflected in their passage through the earth's magnetic field. Only particles with very great energies will reach unhampered any spot on our planet. Thus the earth is surrounded in its way by an energy barrier which decreases in height from an equatorial peak as geomagnetic latitudes increase.",
      "bbox": {
        "x": 0,
        "y": 2310,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "The number of particles in cosmic radiation and their energies can be established by measurements made at different latitudes. The dependence of the number of cosmic-ray particles on the latitude, the so-called latitude effect, determines the distribution of the particles according to their energies, or the energy spectrum of cosmic radiation. The satellite, moving at a speed of five miles per second, crosses from one latitude to another in a very short time. Thus by satellite measurements of cosmic radiation we can determine the effect of the latitude and with this the distribution of the cosmic-ray particles according to their energies. The fact that a great number of these measurements have been made is of inestimable help. Therefore, the satellite data will help us trace the changes both in the composition of cosmic radiation and its intensity.",
      "bbox": {
        "x": 0,
        "y": 2370,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "Sputnik II supplied data on cosmic radiation with two counters. After a signal was broadcast that a definite number of cosmic-ray particles had been counted, the particles were again recorded, with a new signal broadcast as soon as the same number was reached. Dividing the number of recorded particles by the time taken to count them, we obtain the number of particles the counter traps each second. In other words, we find the intensity of radiation. Preliminary organization of the sputnik data on cosmic radiation shows that the counters functioned properly. The dependence of the number of cosmic-ray particles on geomagnetic latitude is clearly evident. Complete systematization of the measurements of the energy spectrum of primary cosmic particles will make it possible to investigate the changes that come with time in this spectrum and compare them with the processes which took place at that time in outer space.",
      "bbox": {
        "x": 0,
        "y": 2430,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "headline",
      "text": "First Space Traveler",
      "bbox": {
        "x": 0,
        "y": 2490,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "Laika, the first living organism to travel for several days through cosmic space, gave science vital data on reactions under gravity-free, weightless conditions. Pulse-beat, respiration, arterial blood pressure and cardiac biopotentials, temperature and pressure in the animal's cabin were recorded and radio-telemetered. To regenerate the air in the cabin and maintain the proper air composition, highly active chemical compounds were used which provided the required amounts of oxygen and absorbed carbon dioxide and surplus vapor. The amount of compounds in chemical reactions was controlled automatically. The cabin was equipped with apparatus to feed the dog and eliminate wastes.",
      "bbox": {
        "x": 0,
        "y": 2510,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "Laika went through a course of training. The animal was gradually accustomed to protracted stays in small hermetically sealed chambers, to the space suit, and to the attached impulse converters that recorded physiological functions. She was also trained to bear up under overstrain, and her resistance to vibration effects and other pertinent factors were tested under laboratory conditions. The actual satellite flight was the culmination of experiments that had been carried on over a number of years by Soviet scientists with animals sent up in rockets to altitudes of 60 to 120 miles. The physiological data received from Sputnik II are being carefully studied. But even now we can say that the dog behaved normally when the satellite was thrust into orbit and bore up well under the subsequent state of weightlessness. The data recorded indicate that the condition of the animal was satisfactory throughout the experiment.",
      "bbox": {
        "x": 0,
        "y": 2570,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "It is apparent that the observations are of momentous importance for the future interplanetary flights and provide the basis for inventions and techniques that will make for safe cosmic travel by human beings. Continued on next page",
      "bbox": {
        "x": 0,
        "y": 2630,
        "width": 100,
        "height": 40
      }
    },
    {
      "type": "image",
      "text": "Diagram of medical and biological data sent by Sputnik II",
      "bbox": {
        "x": 0,
        "y": 2670,
        "width": 100,
        "height": 100
      }
    },
    {
      "type": "caption",
      "text": "MEDICAL AND BIOLOGICAL DATA SENT BY SPUTNIK II Key to Symbols: CR—Cosmic rays. SR—Solar radiation (ultra-violet and X-rays). GO—Gravity zero (weightlessness). R—Respiration. C—Cardiac activity. B—Blood pressure.",
      "bbox": {
        "x": 0,
        "y": 2770,
        "width": 100,
        "height": 40
      }
    },
    {
      "type": "image",
      "text": "Instruments for studying the sun's short-wave radiation",
      "bbox": {
        "x": 0,
        "y": 2810,
        "width": 100,
        "height": 100
      }
    },
    {
      "type": "caption",
      "text": "THESE INSTRUMENTS SENT DATA ON THE SUN'S SHORT-WAVE RADIATION FROM SPUTNIK II.",
      "bbox": {
        "x": 0,
        "y": 2910,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "headline",
      "text": "SPUTNIK II",
      "bbox": {
        "x": 0,
        "y": 2930,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "headline",
      "text": "Cosmic Fact-Finder",
      "bbox": {
        "x": 0,
        "y": 2950,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "headline",
      "text": "Continued",
      "bbox": {
        "x": 0,
        "y": 2970,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "headline",
      "text": "Tracking the Satellite",
      "bbox": {
        "x": 0,
        "y": 2990,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "Sixty-six special optical observation stations and all the astronomical observatories in the Soviet Union, and scores of foreign scientific centers made systematic observations of the two satellites and the carrier rocket of the first sputnik. The brightness of the carrier rocket and the second sputnik also made it possible to use the visual observations obtained by meteorological stations with balloon theodolites. Together with visual observation, the satellites were photographed. This helped define their orbits. Radio tracking also furnished important information. The broadest community of radio amateurs throughout the world tracked the sputniks along the stations specially assigned to this task. Complete analysis of radio observation will yield valuable data on the peculiarities in the ionization of the upper layers of the ionosphere and also of the absorption and propagation of radio waves.",
      "bbox": {
        "x": 0,
        "y": 3010,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "An interesting phenomenon occurred in the passage of Sputnik II near the area of maximum ionization of the atmosphere, where conditions were particularly favorable for the propagation of radio waves through ionospheric channels. In several cases the radio waves reached the receiving stations not via the shortest distance, but after traveling around the longer side of the globe. There were a number of individual reports of world-round radio echo. The duration of the research measurements by the second satellite's instruments had been set for a seven-day period. At the end of the scheduled period the radio transmitters and the telemetering equipment ceased to function. Further tracking of Sputnik II to forecast its flight and to study the upper atmospheric layers was continued by optical observation and through radar.",
      "bbox": {
        "x": 0,
        "y": 3070,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "image",
      "text": "Meteor tracker used to photograph the sputniks",
      "bbox": {
        "x": 0,
        "y": 3130,
        "width": 100,
        "height": 100
      }
    },
    {
      "type": "caption",
      "text": "A METEOR TRACKER USED TO PHOTOGRAPH THE SPUTNIKS. PHOTOS HELPED DEFINE THEIR ORBITS.",
      "bbox": {
        "x": 0,
