      }
    },
    {
      "type": "caption",
      "text": "KAZAKHSTAN OBSERVATORY IS ONE OF MANY SPUTNIK TRACKING CENTERS. OPTICAL OBSERVATIONS ARE IMPORTANT FOR FURTHER SCIENTIFIC RESEARCH.",
      "bbox": {
