    },
    {
      "type": "headline",
      "text": "10",
      "bbox": {
        "x": 0,
        "y": 3370,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "headline",
      "text": "EARTH SATELLITE: Link in Over-all Scientific and Technological Development",
      "bbox": {
        "x": 0,
        "y": 3390,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "byline",
      "text": "By Alexander Topchiev Secretary, USSR Academy of Sciences",
      "bbox": {
        "x": 0,
        "y": 3410,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "THE FIRST SATELLITE to be orbited around the earth was no accidental feat of Soviet science and engineering. Nor was it the product of any single branch of learning. Sputnik reflected the inevitable result of the development of the country's science and technology as a whole. Theoretical and Experimental Physics The greatest headway has been made in the physical sciences. Soviet scientists have done much in developing the theory of relativity, particularly in the aspects of non-stationary solution of Einstein's equation of gravitation and the problem of the law of movement of the system of bodies.",
      "bbox": {
        "x": 0,
        "y": 3430,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "A considerable contribution was made to the development of modern quantum mechanics. An important landmark in this direction was Vladimir Fok's approximate method of resolving the problems of quantum mechanics of many particles. Soviet scientists propounded the theory of the inception of nuclear forces as the outcome of the exchange of light particles which was essential for the development of our ideas about atomic nuclei. The development of the theory of nuclear forces was also greatly influenced by the liquid-drop model of the nucleus suggested by Yakov Frenkel which was further developed in the theory of fission.",
      "bbox": {
        "x": 0,
        "y": 3490,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "One of the most significant achievements of the physical sciences is the discovery of the so-called Vavilov-Cherenkov effect that laid the foundation for the development of new methods of investigating the structure of matter. Soviet scientists have also made a number of important discoveries in the field of nuclear physics, including the discovery of the phenomenon of nuclear isomerism and the discovery of the so-called \"mesotron\" which was later named the pion. These discoveries have opened up new avenues for research in the field of nuclear physics and have contributed to the development of new technologies.",
      "bbox": {
        "x": 0,
        "y": 3550,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "headline",
      "text": "LEARNING MORE ABOUT OUR PLANET",
      "bbox": {
        "x": 0,
        "y": 3610,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "byline",
      "text": "By Mikhail Molodensky Corresponding Member, USSR Academy of Sciences",
      "bbox": {
        "x": 0,
        "y": 3630,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "OBSERVATIONS of the man-made satellites will lead to important conclusions as to the precise shape of our planet. Even the moon's movement allows us to determine one of the basic features of the earth's structure, namely, the fact that it is compressed at the poles. As Sputnik moves in its orbit, it reacts to every change in the earth's gravitational field, with the line of its flight indicating the irregularities. With this new data and the use of modern astronomical and radiolocation methods, the dimensions of our planet can be determined with infinitely greater precision than was previously possible because Sputnik is approximately 50 times closer to the earth's center than the moon.",
      "bbox": {
        "x": 0,
        "y": 3650,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "The plotting of the trajectories of a number of artificial satellites will finally enable us to determine the exact configuration of the earth, an extremely important element in the study of the origin, history and structure of our planet. By knowing the satellites' speed we shall be able to calculate precise measurements of the distances between various points on the globe, thus making the present data more accurate. Geochemists have found out much about the earth's chemical composition. But man-made satellites provide the means for many new findings. New data will be available on the chemical composition of the earth and the changes in this composition that are produced as a result of various cosmic radiations.",
      "bbox": {
        "x": 0,
        "y": 3710,
        "width": 100,
        "height": 60
      }
    },
    {
      "type": "paragraph",
      "text": "Sputniks open new avenues for research in all the earth sciences—gravimetry and geochemistry, geodesy and geophysics, seismography and hydrology. They will give us important information on the composition of the cosmic dust that floats through interstellar space. Science has thus far merely guessed at its nature and properties, but the satellite laboratory will afford the possibility of undertaking a study of this problem from stage to stage. The supposition that cosmic dust is the material out of which planets are formed testifies to the importance of such a laboratory.",
      "bbox": {
        "x": 0,
        "y": 3770,
        "width": 100,
        "height": 60
      }
    }
  ]
